webpackJsonp([0xdd3697394603],{1515:function(p,a){p.exports={data:{markdownRemark:{html:"<p>カリフォルニア大学サンディエゴ校のグローバル紛争と協力に関する研究所は、ファックスを送って、香港に行って学術討論会に出席するように頼んだ。会議のテーマは非常に意味があります：中国のサークル：中華人民共和国、台湾、香港、マカオの相互関係の地域別成果。これは、中国経済が発展し、重要な変化が中国のコミュニティで起こることを前提に議論されている。この変化は、この地域における政治経済と文化の発展において重要な役割を果たすと考えられている。</p>\n<p>会議でのディスカッショントピックのフレームワークは次のとおりです。</p>\n<p>中国、台湾、香港間の経済的相互作用のモデル、および他のアジア太平洋諸国との関係</p>\n<p>エレクトロニクスや織物などの異なる産業部門間の経済的相互作用。</p>\n<p>中国、台湾、香港地域間の経済交流の国内経済的および政治的意義;</p>\n<p>東南アジアの中国の経済的、政治的役割における中国のサークルにおける経済的機会の役割;中国のコミュニティへの東南アジア政策と中国の政策;</p>\n<p>アジアの中国のビジネス組織と活動のモデル。</p>\n<p>中国の円がアジアの文化的実体に与える影響。</p>\n<p>アジア太平洋地域における経済・政治権力分配のための中国の円の意義。</p>\n<p>これらのトピックは、勉強するために非常に必要です。現在、中国経済の発展に向けた積極的な態度を持たず、中国を恐れている人もいる。</p>\n<p>中国の内政と政治が中国と台湾の香港政策に及ぼす影響についての論文を作成しましょう。</p>\n<p>残念ながら、行く時間はありません。</p>",id:"/home/swain/workspace/political-life/src/pages/ja/0163.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ja/0163.md",frontmatter:{title:"10月20日 木曜日"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ja/0163.md absPath of file >>> MarkdownRemark"}}}});
